import { Row, Tabs, Tab, Card } from 'react-bootstrap';
import AddProducts from './product-contents/add-products';

const Product = () => {
    return (
        <div>
            <Tabs defaultActiveKey="overall" transition={false} id="reports_tab" justify fill style={{ margin: '1% 1.5% 1.5% 1.5%' }}>
                <Tab eventKey="overall" title="Products">
                    <AddProducts></AddProducts>
                </Tab>
                <Tab eventKey="yearly" title="Add Products">
                    <AddProducts></AddProducts>
                </Tab>
            </Tabs>
        </div>
    );
}

export default Product;
